import CircleImage from '../circleImage/CircleImage'

const Card = (props) => {

  let components;
  if(props.side == 'left') {
    components = <> <p>left</p><CircleImage imagePath={props.logo} alt={'Logo'} width={80} height={80}/> </>
  } else {
    components = <> <CircleImage imagePath={props.logo} alt={'Logo'} width={80} height={80}/> <p>right</p></>
  }
  return (
    <div className='rightTimelineCard'>
      {components}
    </div>
  )
}

export default Card;
